INSERT INTO "repo_additional_info" VALUES('sarahb1','JSONtoCSV','This contains two files first is java jar file which is made up of the BeanToCsv class Reader class and org JSON library which can be found here https github com douglascrockford JSON java git Compile these into JAR file The JAR file parses JSON it has error handling that will default to my Facebook API rest url if you don give it an input parameter The bat batch file should be saved in the same folder as the jar and your excel file The bat file outputs the parsed json array into csv file which can be opened with excel To use this with VBA use the shell function to call the batch file the batch file calls the jar file and outputs the result Example ShelltoCsv bat json rest url Make sure within vba to also set your directory before you call shell which can be done by writing the following ChDir ThisWorkbook path Please cite Micah Fulton if you plan to use this source code',0,'Shell',104,1,16,16,0.53,0,0,0);
INSERT INTO "repo_additional_info" VALUES('Cheejyg','CZ3007-Compiler-Techniques-Second-Laboratory-Assignment','The goal of this lab is to implement parser for the programming language PL In the previous lab you implemented lexer and in the next two labs you go through semantic analysis and code generation so by the last lab you will have full working compiler from PL to Java bytecode As in the previous lab this lab provides you with preconfigured Eclipse workspace downloadable as zip file from the course website to get you started The workspace contains several supporting files which you do not need to touch and main file containing the beginnings of parser specification using Beaver The workspace also contains rudimentary unit test suite which you are encouraged to use and extend to test your implementation Your assignment will be graded by the instructors using unit test suite so it is imperative that the code you hand in compiles and behaves correctly',0,'Java',5027,1,17,17,0.57,0,0,0);
