INSERT INTO "repo_additional_info" VALUES('mnanda021','GUI-JDBC','Part This is for your own exercise there is no need to hand in the run results GUI Create the GUI programs listed in Chapter and of the textbook using Java IDE tool to generate the GUI code You may use NetBeans or Eclipse as your IDE These IDEs can be installed from textbook CD or download from Internet For each of the above java program please add Java utility class java util Calendar to display the date and time on the outputs Please generate the GUI code using an IDE such as Netbean or Eclipse do not write the GUI code yourself JDBC Create the database books from chapter of the textbook in MySQL The instructions and sql scripts can be found either from the lecture notes or textbook CD You can create your MySQL account in using the script at https bradley edu firewall register pl You may need to use version of IE or Firefox or Chrome that allows you to proceed and ignore the security warning since HTTPS may still have some certificate issues at this time Click the MySQL Book script link to download the SQL script to create the database You can either create the books database use the phpMyAdmin or use the following commands mysql username type in password mysql source mysqlbooks sql Create and test the JDBC programs in chapter Part II GUI Design and develop Book client GUI application program using NetBeans Eclipse Java IDE tool to insert update and delete Book data entries using stub functions stub function is place holder function that is empty except print out what it will do Each group should have your unique GUI design Please generate the GUI code using an IDE do not write the GUI code yourself The user interface windows should have as many of the following major GUI swing components beans as possible Basic Controls JLabel JTextfield JPasswordField JTextArea JCheckBox JButton JRadioButton ButtonGroup JComboBox Drop down list and JList JScrollPane Container components JPanel JTabbedPane JDialog JMenuBar JMenu JMenuItem JCheckBoxMenuItem and JRadioButtonMenuItem Extra Credit Provide user with dynamically generated database tables and data table JTable to insert update and delete data entries JDBC Develop Java application program that implements the stub functions with sql statements against the MySQL Book database Use connection string jdbc mysql bradley edu for MySQL on Develop sqlQuery function using sql Statements to query the Book database tables Develop sqlUpdate function using sql Prepared Statements to insert delete update the Book database tables Test the above functions with the Book database Two Tier client database System Combine the and into two tier client database application Rewrite the JDBC code in the Java application program into Java JDBC class Redirect the in GUI from the local stub functions to the JDBC class functions Test the GUI application with the Book database',0,'Java, CSS, HTML',23897,1,0,0,0.0,0,0,0);
