INSERT INTO "repo_additional_info" VALUES('sonali-developer','EmojiArtNewVersion','App Description full fledged ready to publish app on App Store designed for iPad using Xcode Swift The app starts by displaying the Document Browser in its main screen like local file system from where the user can choose the folder for this app on his her device and upon selection the option for creation of new untitled document become available for the first time whereas for other instances existing documents created before by this app too gets displayed for editing By selecting blank document another screen will be displayed that consists of collection view of emoji on top along with an option to add more emoji in it by selecting from keyboard popped up with the textfield Apart from this file size creation date and timing also appears in the bottom and in the Inspect tab on top right part of screen From there one can either return to document or can directly close it too In the remaining area there is blank view for painting the Emoji Art user can either open up the Safari browser side by side and browse some image or select an emoji from Collection View drag it by long pressing and drop it in the art view In case of bad URL warning gets displayed The dropped image can be resized too Other emoji can be dragged on top of the image and can be resized Once done user can click on done button to exit from the document Upon exit the entire art view gets set as thumbnail to this document file icon thereby making it easy to recognize the file in the folder One can also save the document on cloud and can access it later from other iOS devices Implemented following special utilities in addition to core features Drag and Drop Interaction UITableView UICollectionView UITextField UIScrollView Multithreading Codable File Manager URL UIDocument UIDocumentBrowserVC URLCache UIImagePickerVC Notification KVO SeguesModal Popover Unwind Embed Alerts ActionSheet etc',0,'Swift',328,1,0,0,0.0,0,0,0);
