INSERT INTO "repo_additional_info" VALUES('elsiemalean','Facebook-Ericsson-XL-Axiata-to-Improve-Network-Performance','Jakarta Indonesia Facebook Ericsson and XL Axiata have developed methodology that is expected to enhance and improve network performance of an application to as much as As part of Internet org mission to bring affordable internet access to two thirds of not only Indonesia but also of the entire world connection Facebook and XL Axiata in conjunction to the archipelago leading provider XL Axiata subsidiary of Axis Capital Group based in Kuala Lumpur Malaysia but is servicing all over the world The methodology will be used to measure and improve end to end network performance using simulated Facebook application use cases It has been reviewed that network wide optimization implemented through the joint project delivered up to percent improvement in app coverage In Indonesia percent of users are on GSM EDGE networks yet the country has the fourth largest Facebook user base in the world The changing market realities in the country are reflected in XL Axiata network where in data traffic rose by percent More than half of the operator million subscribers are data users and majority of those use Facebook according to XL Axiata estimates The joint project developed framework for evaluating user key performance indicators KPI based on simulated Facebook application use cases using test agent and correlated these KPIs with network statistics Through this process user impacting issues were identified and addressed throughout the network This move poses warning to the two other leading network providers in Indonesia Indosat and Telkomsel to step up their game The resultant optimizations improved app coverage by up to percent Number of connections completed within three seconds improved up to percent Time to content improved up to percent Upload time improved up to percent Recently the use of data services in Indonesia has increased significantly and is expected to continue into the future We believe app coverage is essential and correlating Facebook application use cases with network wide statistics has proven to be an innovative and efficient way to detect and address network optimization opportunities Facebook and Ericsson are among the founding members of internet org The companies have also announced the creation of joint innovation lab supporting the Internet org initiative The Internet org Innovation Lab an Ericsson Facebook collaboration currently under development at Facebook Menlo Park campus will provide an environment and expertise for optimizing applications networks and services for the next five billion Internet users',0,'Not specified',0,0,0,0,0.0,0,0,0);
