INSERT INTO "repo_additional_info" VALUES('PhoenixWebGroupJay','Google-Diff-Match-Patch--C--','The Diff Match and Patch libraries offer robust algorithms to perform the operations required for synchronizing plain text Diff Compare two blocks of plain text and efficiently return list of differences Match Given search string find its best fuzzy match in block of plain text Weighted for both accuracy and location Patch Apply list of patches onto plain text Use best effort to apply patch even when the underlying text doesn match Currently available in Java JavaScript Dart Objective Lua and Python Regardless of language each library features the same API and the same functionality All versions also have comprehensive test harnesses Algorithms This library implements Myer diff algorithm which is generally considered to be the best general purpose diff layer of pre diff speedups and post diff cleanups surround the diff algorithm improving both performance and output quality This library also implements Bitap matching algorithm at the heart of flexible matching and patching strategy',0,'C#, Lua, C, Prolog, C++',2488,0,0,0,0.0,0,0,0);
