INSERT INTO "repo_additional_info" VALUES('DhananjayGupta300','DevOps-Workflow-for-Automatically-Building-and-Analyzing-Software-Applications','This project simulates the DevOps environment from developers pushing their code to automated building testing and analyzing of code Our Java project simulates this process by downloading repositories from GitHub uploading each repository to local GitLab server which triggers the build process and code analysis in the locally installed Jenkins server Our Jenkins server configuration built tested and analyzed project code using JaCoCo and Understand Our implementation of the DevOps environment focused on Java Maven applications containing unit tests and JaCoCo support The project is implemented in Java and built with Gradle GitHub GitLab and Jenkins Java APIs are used to access GitHub com the local GitLab server and the local Jenkins server from the Main java file The JGit Java library is used for git repository management within our project These dependencies are documented in the build gradle file We were able to successfully perform stress test of our Java application by pushing Github projects through our DevOps simulation without error From the execution of our application to the last job being built in Jenkins it took approximately minutes out of the applications built successfully some of which had included JaCoCo code coverage unit testing results and produced Understand code analysis The remaining failed for variety of reasons such as missing pom xml build file failed unit tests missing plugins etc Please note that our application only pulls the first repository results of our GitHub com query due to GitHub API limitations Despite this GitHub API limitation during our stress test we found that repositories was enough to produce sufficient number of successful builds',0,'Java',283,1,389,389,12.97,0,0,0);
