INSERT INTO "repo_additional_info" VALUES('jeevanpopinjay','Embedded-SQL-in-C','Embedded SQL in The program uses Embedded SQL statements in to access the database created using PostgreSQL Using Empedded SQL in ecpg Program takes input such as the SSN of employee project number hours for the project and salary for the employee Firstly it lists the employee name employee department name salary and the number of dependents Then for each project the employee is working provide list of After providing the current status related with the employee update the number of hours worked by the employee for the project as follows Update Insert Delete If the employee is already working on that project the number of hours will be updated otherwise new tuple will be inserted The program should input the project number each employee SSN and the number of hours from the command line If the number of hours is the tuple is deleted Update If the hours are updated your program should print an update message The number of hours for employee John Smith on project ProductX is updated from to Insert Otherwise an insert message should be printed Employee John Smith started to work on hours on project ProductZ Delete Note that if the number of hours is set to it means the corresponding tuple should be deleted if it already exists Employee John Smith who was working on hours on project ProductZ stopped working on this project The parameters will be read from the command line The message must include the employee name project name number of hours and previous number of hours if applicable The following is sample call for program Company ssn pno hours',0,'Makefile, Logos',21,1,0,0,0.0,0,0,0);
