INSERT INTO "repo_additional_info" VALUES('LiziParhi','Project-Yelp-Dataset','Part Download the Yelp dataset from Camino Look at each JSON file and understand what information the JSON objects provide Pay attention to the data items in JSON objects that you will need for your application For example categories attributes etc You may have to modify your database design from Homework to model the database for the described application scenario on page Your database schema doesn necessarily need to include all the data items provided in the JSON files Your schema should be precise but yet complete It should be designed in sucha way that all queries data retrievals on from the database run efficiently and effectively Produce DDL SQL statements for creating the corresponding tables in relational DBMS Note the constraints including key constraints referential integrity constraints not NULL constraints etc needed for the relational schema to capture and enforce the semantics of your ER design Populate your database with the Yelp data Generate INSERT statements for your tables and run those to insert data into your DB II Part Implement the application for searching local businesses as explained in section Overview Requirements In this milestone you would Write the SQL queries to search your database Establish connectivity with the DBMS Embed execute queries in from the code Retrieve query results and parse the returned results to generate the output that will be displayed on the GUI Implement GUI where the user can browse through main and sub categories for the businesses select the business categories that user wants to search for note The list of the main categories is given in Appendix All other categories that appear in the business objects are sub categories Such distinction is made for easier browsing of the business categories browse through theattributes of theselected categories specify the attributes she he is interested in search for the businesses that belong to the main and sub categories that user specifies and have the attributes that user selects The user should be able to search for the businesses that have either all the attributes AND condition or that have any of the attributes specified ORcondition filteroutthesearchresultsforaspecificstate city orzipcode filteroutthebusinesseswhichareopenorclosedonspecificdaysoftheweek selectacertainbusinessinthesearchresultsandlistallthereviewsforthatbusiness note The review list should also include the names of the users who provided thosereviews',0,'Java',32,1,54,54,1.8,0,0,0);
