INSERT INTO "repo_additional_info" VALUES('celineshaw','Smartgrid-ML-CV-Renewable-energy-data','To help realize the promise of smarter sustainable and reliable electric grid for the future the Smart Grid Focus Group brings together number of interdisciplinary Stanford researchers working on issues such as analyzing large scale individual smart meter data to enhance our knowledge on consumption behavior developing scalable data analytics for demand side energy management strategies modeling and simulation of the electric grid integration and coordination of distributed energy resources and grid stability with renewable energy Smart grids provide more accurate and timely information to companies for making informed energy management decisions and include technologies such as sensing forecasting and data analytics Corporate membership in the Smart Grid Focus Group provides extraordinary access to faculty grad students and cutting edge research in smart grid Annual review meetings will present the latest Stanford research and provide ample opportunities to discuss research plans Companies will have opportunities for informal interactions with professors grad students and other companies Stanford Energy Membership includes membership in the Fellow Mentor Advisor Program or focus group such as the Batteries Focus Group Smart Grid Focus Group or Solar Focus Group',0,'Not specified',0,0,0,0,0.0,0,0,0);
