INSERT INTO "repo_additional_info" VALUES('Sidharth15BCE0075','Analysis-on-Task-Allocation-and-Load-Balancing-in-Distributed-Systems','Distributed systems are the distributed computational units which are connected and organized by networks to meet the demand of large scale and high performance computing that have received considerable attention over the past decades There are many types of distributed systems such as grids peer to peer systems ad hoc networks cloud computing systems pervasive computing systems and online social network systems In past decades there are significant amount of studies for this area which could cause people to be puzzled by the enormous amount of wide variety of research results Although there have been some related surveys previously but most of which only made very preliminary review on the state of art of one single type of distributed system such as the survey of load balancing in grids the survey of load balancing in cloud computing and the survey of load balancing in systems Then how to correlate the related studies in varying types of distributed systems and make general taxonomy on them To solve the above problem first this analysis of this paper summarizes the typical characteristics of general distributed systems such as the distributed control resource distribution open environments heterogeneous nodes and network structures Then the analysis of this paper categorizes the existing studies on task allocation and load balancing based on how they can satisfy the characteristics of distributed systems which includes the following aspects control models resource optimization ensuring reliability coordination mechanisms and measures to consider network structures With this analysis general and macroscopic review of task allocation and load balancing for varying types of distributed systems can be achieved which can have higher generality much than the previous preliminary surveys for only one single type of systems',0,'Not specified',0,0,0,0,0.0,0,0,0);
